import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Navb from '../Navbar/Nav';
// import MovieList from './MovieList';

const Home = () => {
  const [movies, setMovies] = useState([]);

  useEffect(() => {
    const fetchMovies = async () => {
      try {
        const response = await axios.get(`https://api.themoviedb.org/3/movie/550?api_key=${process.env.URLKEY}`); // Replace with your API endpoint URL and access the API key correctly
        setMovies([response.data.data]); // Wrap the response data in an array or modify it to match the expected format of the MovieList component
      } catch (error) {
        console.error('Error fetching movies:', error);
      }
    };

    fetchMovies();
  }, []);

  return (
    <div>
      <Navb />
      <MovieList movies={movies} />
    </div>
  );
};

export default Home;
